import { MapProps, Province, Region } from "./schema";

export const defaultViewBox = { x: 767, y: 371 };
export const viewBox = (coord?: { x: number; y: number }) => {
  if (!!coord) {
    return { x: coord.x, y: coord.y };
  } else {
    return defaultViewBox;
  }
};

export const SelectedThisPlace = (r: Region, p: Province) => {
  if (!SelectedRegion) {
    SelectRegion(r);
  } else {
    if (SelectedProvince?.id == p.id) {
      SelectRegion(r);
      SelectProvince();
    } else {
      SelectRegion(r);
      SelectProvince(p);
    }
  }
};
export let SelectedRegion: Region | undefined = undefined;
export const SelectRegion = (reg?: Region) => {
  if (!!reg) {
    SelectedRegion = reg;
  } else {
    SelectedRegion = undefined;
  }
};
export let SelectedProvince: Province | undefined = undefined;
export const SelectProvince = (aimag?: Province) => {
  if (!!aimag) {
    SelectedProvince = aimag;
  } else {
    SelectedProvince = undefined;
  }
};

